import React from 'react';
import { IoIosPerson } from 'react-icons/io';
import './Avatar.css';
import { IoCamera } from 'react-icons/io5';
import { TweenMax, Expo } from 'gsap';

// Avatar user compte
export default function REturnAvataR() {

 React.useEffect(() => {
  TweenMax.from('.wrp-user-sub-avatar', 1.2, { delay: .9, opacity: 0, y: 30, ease: Expo.easeInOut })

 }, []);

 return (
  <div className='wrp-user-avatar'>
   <div className='wrp-user-sub-avatar'>

    <div className='icon-avatar'>
     <IoIosPerson size={'8rem'} />
    </div>

    <div className='wrp-icon-camera'>
     <IoCamera size={'2rem'} />
    </div>

   </div>
  </div>
 );
};
